import React from "react";
import styled from "styled-components";

const NavBar = styled.nav`
  width: 100%;
  padding: 20px 10px;
  background: #fbf8f5;
`;

const Header = () => {
  return (
    <NavBar>
      <div>hello from nav</div>
    </NavBar>
  );
};

export default Header;
